window.bookSummaryJSON = "<p><b>I'm like a snowball rolling downhill.</b></p> <p>That's the first thing that pops into my mind when I try to explain my life. I don't know exactly \"what'\"I am, but I do know who I am. At least...I did.</p> <p>Sometimes life sends things your way that upend everything you thought you knew, and then slings you in another direction without any sort of harness or warning.</p> <p>Sometimes it drops someone like me off in the path of four wildly different monsters, who all used to be best friends, but now sort of hate each other and compete over absolutely everything, including...me.</p> <p>Life would be easier if I wasn't already attached to those four monsters, but they occasionally let their guard down around me, and I get a glimpse of what has to stay hidden under all those snowball layers, since they already rolled downhill a long time ago.</p> <p>I'm tired of losing people I care about. I'm tired of searching aimlessly for answers. I'm tired of not having the right questions to ask.</p> <p>Contains mature themes.</p>"; 
